import React from 'react';

import Header from './components/header/Header';
import Footer from './components/footer/Footer';
import Home from './views/Home';

function App() {
  return (
    <div className="App">
        <Header />

        <Home />

        <ProjectList />

        <Contact />

        <Footer />
    </div>
  );
}

export default App;
